public class WriteableCommandLineImpl extends org.apache.commons.cli2.commandline.CommandLineImpl implements org.apache.commons.cli2.WriteableCommandLine {
    private final java.util.Properties properties = new java.util.Properties();

    private final java.util.List options = new java.util.ArrayList();

    private final java.util.Map nameToOption = new java.util.HashMap();

    private final java.util.Map values = new java.util.HashMap();

    private final java.util.Map switches = new java.util.HashMap();

    private final java.util.Map defaultValues = new java.util.HashMap();

    private final java.util.Map defaultSwitches = new java.util.HashMap();

    private final java.util.List normalised;

    private final java.util.Set prefixes;

    public WriteableCommandLineImpl(final org.apache.commons.cli2.Option rootOption, final java.util.List arguments) {
        this.prefixes = rootOption.getPrefixes();
        this.normalised = arguments;
    }

    public void addOption(org.apache.commons.cli2.Option option) {
        options.add(option);
        nameToOption.put(option.getPreferredName(), option);
        for (java.util.Iterator i = option.getTriggers().iterator(); i.hasNext();) {
            nameToOption.put(i.next(), option);
        }
    }

    public void addValue(final org.apache.commons.cli2.Option option, final java.lang.Object value) {
        if (option instanceof org.apache.commons.cli2.Argument) {
            addOption(option);
        }
        java.util.List valueList = ((java.util.List) (values.get(option)));
        if (valueList == null) {
            valueList = new java.util.ArrayList();
            values.put(option, valueList);
        }
        valueList.add(value);
    }

    public void addSwitch(final org.apache.commons.cli2.Option option, final boolean value) {
        addOption(option);
        if (switches.containsKey(option)) {
            throw new java.lang.IllegalStateException(org.apache.commons.cli2.resource.ResourceHelper.getResourceHelper().getMessage(ResourceConstants.SWITCH_ALREADY_SET));
        } else {
            switches.put(option, value ? java.lang.Boolean.TRUE : java.lang.Boolean.FALSE);
        }
    }

    public boolean hasOption(final org.apache.commons.cli2.Option option) {
        final boolean present = options.contains(option);
        return present;
    }

    public org.apache.commons.cli2.Option getOption(final java.lang.String trigger) {
        return ((org.apache.commons.cli2.Option) (nameToOption.get(trigger)));
    }

    public java.util.List getValues(final org.apache.commons.cli2.Option option, final java.util.List defaultValues) {
        java.util.List valueList = ((java.util.List) (values.get(option)));
        if ((valueList == null) || valueList.isEmpty()) {
            valueList = defaultValues;
        }
        if ((valueList == null) || valueList.isEmpty()) {
            valueList = ((java.util.List) (this.defaultValues.get(option)));
        }
        if (valueList == null) {
            valueList = java.util.Collections.EMPTY_LIST;
        }
        return valueList;
    }

    public java.util.List getUndefaultedValues(org.apache.commons.cli2.Option option) {
        java.util.List valueList = ((java.util.List) (values.get(option)));
        if (valueList == null) {
            valueList = java.util.Collections.EMPTY_LIST;
        }
        return valueList;
    }

    public java.lang.Boolean getSwitch(final org.apache.commons.cli2.Option option, final java.lang.Boolean defaultValue) {
        java.lang.Boolean bool = ((java.lang.Boolean) (switches.get(option)));
        if (bool == null) {
            bool = defaultValue;
        }
        if (bool == null) {
            bool = ((java.lang.Boolean) (this.defaultSwitches.get(option)));
        }
        return bool;
    }

    public void addProperty(final java.lang.String property, final java.lang.String value) {
        properties.setProperty(property, value);
    }

    public java.lang.String getProperty(final java.lang.String property, final java.lang.String defaultValue) {
        return properties.getProperty(property, defaultValue);
    }

    public java.util.Set getProperties() {
        return java.util.Collections.unmodifiableSet(properties.keySet());
    }

    public boolean looksLikeOption(final java.lang.String trigger) {
        for (final java.util.Iterator i = prefixes.iterator(); i.hasNext();) {
            final java.lang.String prefix = ((java.lang.String) (i.next()));
            if (trigger.startsWith(prefix)) {
                return true;
            }
        }
        return false;
    }

    public java.lang.String toString() {
        final java.lang.StringBuffer buffer = new java.lang.StringBuffer();
        for (final java.util.Iterator i = normalised.iterator(); i.hasNext();) {
            final java.lang.String arg = ((java.lang.String) (i.next()));
            if (arg.indexOf(' ') >= 0) {
                buffer.append("\"").append(arg).append("\"");
            } else {
                buffer.append(arg);
            }
            if (i.hasNext()) {
                buffer.append(' ');
            }
        }
        return buffer.toString();
    }

    public java.util.List getOptions() {
        return java.util.Collections.unmodifiableList(options);
    }

    public java.util.Set getOptionTriggers() {
        return java.util.Collections.unmodifiableSet(nameToOption.keySet());
    }

    public void setDefaultValues(final org.apache.commons.cli2.Option option, final java.util.List defaults) {
        if (defaults == null) {
            defaultValues.remove(option);
        } else {
            defaultValues.put(option, defaults);
        }
    }

    public void setDefaultSwitch(final org.apache.commons.cli2.Option option, final java.lang.Boolean defaultSwitch) {
        if (defaultSwitch == null) {
            defaultSwitches.remove(option);
        } else {
            defaultSwitches.put(option, defaultSwitch);
        }
    }

    public java.util.List getNormalised() {
        return java.util.Collections.unmodifiableList(normalised);
    }
}
